q=h.is("6. Data Security","We implement appropriate technical and organizational security measures to protect your personal information, including:\n\n\u2022 Encryption of data in transit (HTTPS/TLS)\n\u2022 Secure authentication mechanisms\n\u2022 Regular security assessments\n\u2022 Access controls and authentication for our systems\n\nHowever, no method of transmission over the Internet or electronic storage is 100% secure. While we strive to protect your personal information, we cannot guarantee its absolute security.")
p=h.is("7. Data Retention","We retain your personal information for as long as your account is active or as needed to provide you services. We will retain and use your information as necessary to:\n\n\u2022 Comply with our legal obligations\n\u2022 Resolve disputes\n\u2022 Enforce our agreements\n\nYou may request deletion of your account and associated data at any time by contacting us.")
o=h.is("8. Your Rights and Choices","Depending on your location, you may have the following rights:\n\n\u2022 Access: Request access to your personal information\n\u2022 Correction: Request correction of inaccurate data\n\u2022 Deletion: Request deletion of your personal information\n\u2022 Portability: Request a copy of your data in a portable format\n\u2022 Opt-out: Opt out of marketing communications\n\nTo exercise these rights, please contact us using the information below.")
